import React from "react";
import { Link } from "react-router-dom";

const BookInfo = ()=>{
    return(
        <div id="books__body">
                <main id="books__main">
                 <div className="books__container">
                    <div className="row">
                        <div className="book__selected--top">
                            <Link to="/books" className="book__link">
                                
                            </Link>
                        </div>
                    </div>
                 </div>
                </main>
        </div>
    )
}

export default BookInfo
